import { useState } from "react";
import { Link } from "react-router-dom";
import '../styles/SignUp.css';

export default function SignUp () {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  return (
    <div className="sign-up">
      <form>
        <label htmlFor="username">Username
          <input type='text' name='username' value={username} onChange={(e) => setUsername(e.target.value)}></input>
        </label>
        <label htmlFor="password">Password
          <input type='password' name='password' value={password} onChange={(e) => setPassword(e.target.value)}></input>
        </label>
        <label htmlFor="confirm-password">Password
          <input type='password' name='confirm-password' value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)}></input>
        </label>
        <p>Already have an account?</p><Link to='/login'>Log In</Link>
        <input type='submit' value='Sign Up'></input>
      </form>
    </div>
  )
}
